//import axios from "axios";
import {Card, Button, Form} from 'react-bootstrap'
const GroupList = (props) => {
    return(
        <div className="group-item">
            <p>{props.name}</p>
            <p>{props.description}</p>
        </div>
    )
};

export default GroupList;
